description:
Целевой системой является ЕФ.А-Монитор.
Описание нецелевой системы.
A-Monitor - это система мониторинга структурных нот.
Под структурной нотой понимается гибридный инвестиционный продукт, состоящий из комбинации финансовых инструментов и разработанный с целью достижения заданных результатов в соответствии с риск-профилем инвестора.

Цели системы A-Monitor: 
- ввод и хранение данных по структурным инвестиционным продуктам;
- импорт данных из коробочных решений, не обладающих необходимым для бизнеса функционалом по работе со структурными продуктами;
- автоматизация процесса контроля триггерных точек структурных инвестиционных продуктов А-Клуба;
- оценка риска и контроль портфеля структурных инвестиционных продуктов клиентов А-Клуба;
- построение автоматизированной отчетности.

Уточнения/ограничения:
- модули системы разрабатываются на экостеке (frontend - React, backend - Java, SpringBoot).
